import React from "react";
import Certificate from "./assets/certif-1.png";



const Certif=()=>{
    return(
      <>
      <div className="container">
      <a href="" target="_blank" ><img src={Certificate} className="logos" /> </a>

      </div>
      </>
    );
}
export default Certif;
